import React, { Component } from 'react';
import './aboutscreen.css';
import profilePic from '../assets/me.jpg'

class AboutScreen extends Component {
	render() {
		return (
			<div className="container">
				<div className="left-margin"></div>

				<div className="main">
					<div className="picContainer">
						<img src={profilePic} />
					</div>
					<div className="bioContainer">
						<h1>About me</h1>
						<p>
							I'm currently a 3rd year undergraduate student 
							studying Computer Science and Engineering at the 
							University of California, Los Angeles. I spent the 
							past two summers interning at a San Francisco 
							based startup called iBeat, which is developing a 
							smart watch which continually monitors vital signs 
							and alerts medical authorities in the event of a 
							life-threatening condition. </p>
					</div>
				</div>

				<div className="right-margin"></div>
			</div>
		);
	}
}

export default AboutScreen;
